import React,{useEffect} from 'react'

const Home = () => {
    useEffect(() => {
        fetch("https://api.covid19api.com/summary")
        .then(data => console.log(data))
        .catch(err => console.log(err))
    },[])
    return(
        <div>Home Screen!</div>
    )
}

export default Home
